import React from "react";
import '../assets/styles/all.css';
import '../assets/styles/modalClose.css';

const ModalCloseButton = ({onClick}) => {
    return(
        <>
        <img src={require("../assets/images/X_button.png").default} onClick={onClick} className="modal_close" type="button" alt="닫기"></img>
        </>
    )
}

export default ModalCloseButton;
